//Добавление динамической роли "СЭД.Инициатор"
(function(){
    var ord = stm_document,
        currentEmployee = orgstructure.getCurrentEmployee();
    lecmPermission.grantDynamicRole(ord, currentEmployee, "DA_INITIATOR_DYN", "LECM_BASIC_PG_Owner");
})();

(function(){
    var ord = stm_document;  
    var controllerAssoc = ord.assocs["lecm-ord:controller-assoc"];
    if (controllerAssoc!=null && controllerAssoc.length > 0) {
        var controller = controllerAssoc[0];
        // выдадим права контролеру
        statemachine.grandDynamicRoleForEmployee(ord, controller, "DA_CONTROLLER_DYN");
    }
})();

//направить на регистрацию
(function(){
    var i,
        ord = stm_document, //орд документ
        registrars = ordStatemachine.getRegistrars("DA_REGISTRARS", ord),//получение списка регистраторов по документу
        registrarsCount = registrars.length,
        notification;

    //раздаем права регистраторам
    for(i = 0; i < registrarsCount; ++i) {
        statemachine.grandDynamicRoleForEmployee(ord, registrars[i], "DA_REGISTRAR_DYN");
    }

    //подготавливаем уведомление
    notification = ordStatemachine.prepareNotificationAboutRegistration(ord, registrars);

    //рассылаем уведомление
    notifications.sendNotification(notification);
})();

// пришло с "Подписать и направить"
(function() {
    var previousStatusName =  statemachine.getPreviousStatusName(stm_document),
        currentEmployee, resultList, taskDecision;

    if (previousStatusName == "Проект" | previousStatusName == "На доработке" | previousStatusName == "Согласован") {
        currentEmployee = orgstructure.getCurrentEmployee();

        resultList = signingWorkflow.createEmptyResultList(bpm_package, "Внутренний");
        signingWorkflow.createResultItem(resultList, currentEmployee);

        taskDecision = signingWorkflow.getSignedDecision(currentEmployee);
        signingWorkflow.logDecision(resultList, taskDecision);

        signingWorkflow.deleteTempAssigneesList(execution);

        signingWorkflow.addSignBusinessJournalRecord(bpm_package, currentEmployee);
    }
})();

//
(function(){
    var ord = stm_document;

    //Регистрация
    regnumbers.registerDocument(ord, "ORD_NUMBER");
    ord.save();

    //Отмена документов
    ordStatemachine.repealDocuments(ord);

    //Введение в действие
    ordStatemachine.enactDocuments(ord);

    //Перевод в следующий статус
    var controllerAssoc = ord.assocs["lecm-ord:controller-assoc"];
    if (controllerAssoc!=null && controllerAssoc.length > 0) {
        statemachine.executeTransitionAction(ord, "На исполнение");
    }
})();

//
(function(){
    var ord = stm_document;
    var controllerAssoc = ord.assocs["lecm-ord:controller-assoc"];
    if (controllerAssoc!=null && controllerAssoc.length > 0) {
        var controller = controllerAssoc[0];
        var tableAssocs = ord.assocs["lecm-ord-table-structure:items-assoc"];
        if (tableAssocs!=null && tableAssocs.length > 0){
            var table = tableAssocs[0];
            var  pointAssocs = table.childAssocs["cm:contains"]; 
            if (pointAssocs!=null && pointAssocs.length > 0 ){
                // формируем поручения
                ordStatemachine.formErrands(ord);
            }
        }

        // выдадим права контролеру
        statemachine.grandDynamicRoleForEmployee(ord, controller, "DA_CONTROLLER_DYN");

        //подготавливаем уведомление 
        notification = ordStatemachine.prepareNotificationToController(ord, controller);

        //рассылаем уведомление
        notifications.sendNotification(notification);
    }
})();
